import React from "react";
import "./navBar.css";
import logo from "../../assets/logo.png";
const NavBar = () => {
  return (
    <nav className="navBar">
      <img src={logo} alt="Logo" className="logo" />
      <div className="navBarMenu"></div>
      <button className="contactMe">
        <img src="" alt="" />
        Contact Me
      </button>
    </nav>
  );
};

export default NavBar;
